INSERT INTO `wp_cmplz_cookiebanners` VALUES (1,15,1,0,'bottom-right view-preferences','bottom-right','','slider','hide','0','1','Manage consent','hover-hide-mobile','a:2:{s:4:\"text\";s:21:\"Manage Cookie Consent\";s:4:\"show\";i:1;}','a:2:{s:4:\"text\";s:4:\"Deny\";s:4:\"show\";i:1;}','Save preferences','View preferences','Functional','a:2:{s:4:\"text\";s:9:\"Marketing\";s:4:\"show\";i:1;}','a:2:{s:4:\"text\";s:10:\"Statistics\";s:4:\"show\";i:1;}','a:2:{s:4:\"text\";s:11:\"Preferences\";s:4:\"show\";i:1;}','Accept','To provide the best experiences, we use technologies like cookies to store and/or access device information. Consenting to these technologies will allow us to process data such as browsing behavior or unique IDs on this site. Not consenting or withdrawing consent, may adversely affect certain features and functions.','view-preferences',0,526,0,0,0,'10','a:2:{s:4:\"text\";s:6:\"Accept\";s:4:\"show\";i:1;}','To provide the best experiences, we use technologies like cookies to store and/or access device information. Consenting to these technologies will allow us to process data such as browsing behavior or unique IDs on this site. Not consenting or withdrawing consent, may adversely affect certain features and functions.','0','/* Container */\r\n.cmplz-cookiebanner{}\r\n\r\n/* Logo */\r\n.cmplz-cookiebanner .cmplz-logo{}\r\n/* Title */\r\n.cmplz-cookiebanner .cmplz-title{}\r\n/* Close icon */\r\n.cmplz-cookiebanner .cmplz-close{}\r\n\r\n/* Message */\r\n.cmplz-cookiebanner .cmplz-message{}\r\n\r\n /* All buttons */\r\n.cmplz-buttons .cmplz-btn{}\r\n/* Accept button */\r\n.cmplz-btn .cmplz-accept{} \r\n /* Deny button */\r\n.cmplz-btn .cmplz-deny{}\r\n /* Save preferences button */\r\n.cmplz-btn .cmplz-deny{}\r\n /* View preferences button */\r\n.cmplz-btn .cmplz-deny{}\r\n\r\n /* Document hyperlinks */\r\n.cmplz-links .cmplz-documents{}\r\n\r\n /* Categories */\r\n.cmplz-cookiebanner .cmplz-category{}\r\n.cmplz-cookiebanner .cmplz-category-title{} \r\n\r\n/* Manage consent tab */\r\n#cmplz-manage-consent .cmplz-manage-consent{} \r\n\r\n/* Soft cookie wall */\r\n.cmplz-soft-cookiewall{}\r\n\r\n/* Placeholder button - Per category */\r\n.cmplz-blocked-content-container .cmplz-blocked-content-notice{}\r\n\r\n/* Placeholder button & message - Per service */\r\n.cmplz-blocked-content-container .cmplz-blocked-content-notice,\r\n.cmplz-blocked-content-notice{}\r\nbutton.cmplz-accept-service{}\r\n\r\n/* Styles for the AMP notice */\r\n#cmplz-consent-ui, #cmplz-post-consent-ui {}\r\n/* Message */\r\n#cmplz-consent-ui .cmplz-consent-message {}\r\n/* Buttons */\r\n#cmplz-consent-ui button, #cmplz-post-consent-ui button {}','a:0:{}','a:2:{s:4:\"text\";s:289:\"The technical storage or access is strictly necessary for the legitimate purpose of enabling the use of a specific service explicitly requested by the subscriber or user, or for the sole purpose of carrying out the transmission of a communication over an electronic communications network.\";s:4:\"show\";i:1;}','a:2:{s:4:\"text\";s:82:\"The technical storage or access that is used exclusively for statistical purposes.\";s:4:\"show\";i:1;}','a:2:{s:4:\"text\";s:317:\"The technical storage or access that is used exclusively for anonymous statistical purposes. Without a subpoena, voluntary compliance on the part of your Internet Service Provider, or additional records from a third party, information stored or retrieved for this purpose alone cannot usually be used to identify you.\";s:4:\"show\";i:1;}','a:2:{s:4:\"text\";s:144:\"The technical storage or access is necessary for the legitimate purpose of storing preferences that are not requested by the subscriber or user.\";s:4:\"show\";i:1;}','a:2:{s:4:\"text\";s:181:\"The technical storage or access is required to create user profiles to send advertising, or to track the user on a website or across several websites for similar marketing purposes.\";s:4:\"show\";i:1;}','a:2:{s:5:\"color\";s:7:\"#7a7a53\";s:6:\"border\";s:7:\"#f2f2f2\";}','a:2:{s:5:\"color\";s:7:\"#3c3c3c\";s:9:\"hyperlink\";s:7:\"#1E73BE\";}','a:3:{s:10:\"background\";s:7:\"#1e73be\";s:6:\"bullet\";s:7:\"#ffffff\";s:8:\"inactive\";s:7:\"#F56E28\";}','a:5:{s:3:\"top\";i:12;s:5:\"right\";i:12;s:6:\"bottom\";i:12;s:4:\"left\";i:12;s:4:\"type\";s:2:\"px\";}','a:4:{s:3:\"top\";i:0;s:5:\"right\";i:0;s:6:\"bottom\";i:0;s:4:\"left\";i:0;}','12','a:3:{s:10:\"background\";s:7:\"#c7e4e2\";s:6:\"border\";s:7:\"#3c3c3c\";s:4:\"text\";s:7:\"#3c3c3c\";}','a:3:{s:10:\"background\";s:7:\"#e6e6da\";s:6:\"border\";s:7:\"#3c3c3c\";s:4:\"text\";s:7:\"#222222\";}','a:3:{s:10:\"background\";s:7:\"#f9f9f9\";s:6:\"border\";s:7:\"#3c3c3c\";s:4:\"text\";s:7:\"#333333\";}','a:5:{s:3:\"top\";i:6;s:5:\"right\";i:6;s:6:\"bottom\";i:6;s:4:\"left\";i:6;s:4:\"type\";s:2:\"px\";}','none',1,0,0,0,1);
