INSERT INTO `wp_posts` VALUES (9,1,'2022-10-29 14:49:33','2022-10-29 13:49:33','<!-- wp:heading -->\n<h2>My Blog</h2>\n<!-- /wp:heading -->\n\n<!-- wp:block {\"ref\":350} /-->\n\n<!-- wp:list -->\n<ul></ul>\n<!-- /wp:list -->','Blog','','publish','closed','closed','','blog','','','2023-01-14 18:02:04','2023-01-14 18:02:04','',13,'http://localhost:8888/monochrome_pro/block-content-examples/',3,'page','',0),(10,1,'2022-10-29 14:49:33','2022-10-29 13:49:33','<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":323,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-rounded\"} -->\n<figure class=\"wp-block-image size-full is-style-rounded\"><img src=\"https://madfallstg.wpengine.com/wp-content/uploads/2022/11/georgina-and-goat@0.5x-edited.png\" alt=\"\" class=\"wp-image-323\"/></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:columns {\"verticalAlignment\":\"top\",\"align\":\"wide\",\"style\":{\"color\":{\"background\":\"#e6e6da\",\"text\":\"#3c3c3c\"}},\"className\":\"has-2-columns\"} -->\n<div class=\"wp-block-columns alignwide are-vertically-aligned-top has-2-columns has-text-color has-background\" style=\"background-color:#e6e6da;color:#3c3c3c\"><!-- wp:column {\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\"><!-- wp:heading {\"style\":{\"color\":{\"text\":\"#5a5a5a\"}}} -->\n<h2 class=\"has-text-color\" style=\"color:#5a5a5a\">About</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#5a5a5a\"}}} -->\n<p class=\"has-text-color\" style=\"color:#5a5a5a\">My name is Georgina, I am a freelance Tech VA and website designer from Hillingdon.  I love travelling, wine, long walks goats and horses.  I\'ve spent nearly two decades working as cabin crew, travelling the world and looking after thousands of customers at 35000 feet.  I\'ve always loved technology and my web design knowledge allows me to build beautiful websites for lovely businesses and people.   </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','About Me','','publish','closed','closed','','about-me','','','2022-11-13 14:07:57','2022-11-13 14:07:57','',13,'http://localhost:8888/monochrome_pro/about-us/',1,'page','',0),(11,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','','about','','inherit','open','closed','','about','','','2022-10-29 14:49:34','2022-10-29 13:49:34','',10,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/10/about.jpg',0,'attachment','image/jpeg',0),(12,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','<!-- wp:heading -->\n<h2>Contact Me</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>madfall.business@gmail.com</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"formId\":\"25\",\"displayTitle\":false,\"displayDesc\":false} /-->','Contact Us','','publish','closed','closed','','contact','','','2022-11-11 15:19:30','2022-11-11 15:19:30','',13,'http://localhost:8888/monochrome_pro/contact-us/',4,'page','',0),(13,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','<!-- wp:group {\"style\":{\"color\":{\"background\":\"#e6e6da\",\"text\":\"#3c3c3c\"}},\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group has-text-color has-background\" style=\"color:#3c3c3c;background-color:#e6e6da\"><!-- wp:image {\"align\":\"center\",\"id\":92,\"width\":261,\"height\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-rounded\"} -->\n<figure class=\"wp-block-image aligncenter size-full is-resized is-style-rounded\"><img src=\"https://www.madfall.digital/wp-content/uploads/2022/11/IMG_BE6B95CEFDA1-1.jpeg\" alt=\"\" class=\"wp-image-92\" width=\"261\" height=\"260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":1} -->\n<h1 class=\"has-text-align-center\">Web Designer and Developer from Uxbridge UK</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-align-center has-medium-font-size\">Hi, I\'m Georgina a Web Designer based near Uxbridge.  I build beautiful websites for the service, wellness and hospitality industry.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\"><!-- wp:genesis-blocks/gb-container {\"containerMarginTop\":0,\"containerMarginBottom\":0,\"containerWidth\":\"full\",\"containerMaxWidth\":1600,\"className\":\"gb-layout-landing-2\"} -->\n<div class=\"wp-block-genesis-blocks-gb-container gb-layout-landing-2 gb-block-container alignfull\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\" style=\"max-width:1600px\"><!-- wp:genesis-blocks/gb-columns {\"columns\":2,\"layout\":\"gb-2-col-equal\",\"columnsGap\":4,\"align\":\"full\",\"marginSync\":true,\"paddingTop\":8,\"paddingRight\":5,\"paddingBottom\":8,\"paddingLeft\":5,\"paddingUnit\":\"%\",\"customBackgroundColor\":\"#c7e4e2\",\"columnMaxWidth\":900,\"className\":\"gb-layout-service-3\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-service-3 gb-layout-columns-2 gb-2-col-equal gb-has-custom-background-color gb-columns-center alignfull\" style=\"padding-top:8%;padding-right:5%;padding-bottom:8%;padding-left:5%;background-color:#c7e4e2\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-4 gb-is-responsive-column\" style=\"max-width:900px\"><!-- wp:genesis-blocks/gb-column {\"lock\":{\"move\":false,\"remove\":false}} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:image {\"id\":54,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-full is-style-default\"><img src=\"https://www.madfall.digital/wp-content/uploads/2022/11/063-Georgina-John-Wedding-Killiehuntly.jpg\" alt=\"\" class=\"wp-image-54\"/></figure>\n<!-- /wp:image --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column {\"customTextColor\":\"#3c3c3c\",\"columnVerticalAlignment\":\"center\",\"lock\":{\"move\":false,\"remove\":false}} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column gb-is-vertically-aligned-center\"><div class=\"gb-block-layout-column-inner gb-has-custom-text-color\" style=\"color:#3c3c3c\"><!-- wp:heading {\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<h2 class=\"has-text-color\" style=\"color:#3c3c3c\">Check out my blog</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"400\"}},\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\" style=\"font-style:normal;font-weight:400\">Like most humans, I love to share my thoughts, and writing about web design and business keeps me curious.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:genesis-blocks/gb-button {\"buttonText\":\"Web Design Blog\",\"buttonBackgroundColor\":\"#7a7a53\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\"} -->\n<div class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://www.madfall.digital/landing-page/blog/\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#7a7a53\">Web Design Blog</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":2,\"layout\":\"gb-2-col-equal\",\"columnsGap\":4,\"align\":\"full\",\"marginSync\":true,\"paddingTop\":8,\"paddingRight\":5,\"paddingBottom\":8,\"paddingLeft\":5,\"paddingUnit\":\"%\",\"customBackgroundColor\":\"#e6e6da\",\"columnMaxWidth\":900,\"className\":\"gb-layout-service-3\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-service-3 gb-layout-columns-2 gb-2-col-equal gb-has-custom-background-color gb-columns-center alignfull\" style=\"padding-top:8%;padding-right:5%;padding-bottom:8%;padding-left:5%;background-color:#e6e6da\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-4 gb-is-responsive-column\" style=\"max-width:900px\"><!-- wp:genesis-blocks/gb-column {\"columnVerticalAlignment\":\"center\"} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column gb-is-vertically-aligned-center\"><div class=\"gb-block-layout-column-inner\"><!-- wp:heading {\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<h2 class=\"has-text-color\" id=\"work\" style=\"color:#3c3c3c\">Check out my work</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#3c3c3c\"}},\"className\":\"p-have-mentioned\",\"fontSize\":\"small\",\"gbResponsiveSettings\":{\"1200px\":{\"fontSize\":\"1em\"},\"600px\":{\"fontSize\":\"small\"}}} -->\n<p class=\"p-have-mentioned has-text-color has-small-font-size\" style=\"color:#3c3c3c\">Have I mentioned I\'m a Tech VA who builds websites? Maybe I\'ll even build your next site! </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:genesis-blocks/gb-button {\"buttonText\":\"What I\'ve Built\",\"buttonBackgroundColor\":\"#7a7a53\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\"} -->\n<div class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://www.madfall.digital/landing-page/my-work/\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#7a7a53\">What I\'ve Built</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column {\"columnVerticalAlignment\":\"center\"} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column gb-is-vertically-aligned-center\"><div class=\"gb-block-layout-column-inner\"><!-- wp:image {\"id\":24,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://www.madfall.digital//wp-content/uploads/2022/10/sample-post-5.jpg\" alt=\"Web Designer Laptop\" class=\"wp-image-24\"/></figure>\n<!-- /wp:image --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":2,\"layout\":\"gb-2-col-equal\",\"columnsGap\":4,\"align\":\"full\",\"marginSync\":true,\"paddingTop\":8,\"paddingRight\":5,\"paddingBottom\":8,\"paddingLeft\":5,\"paddingUnit\":\"%\",\"customBackgroundColor\":\"#c7e4e2\",\"columnMaxWidth\":900,\"className\":\"gb-layout-service-3\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-service-3 gb-layout-columns-2 gb-2-col-equal gb-has-custom-background-color gb-columns-center alignfull\" style=\"padding-top:8%;padding-right:5%;padding-bottom:8%;padding-left:5%;background-color:#c7e4e2\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-4 gb-is-responsive-column\" style=\"max-width:900px\"><!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:image {\"id\":52,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://www.madfall.digital/wp-content/uploads/2022/11/048-Georgina-John-Wedding-Killiehuntly.jpg\" alt=\"\" class=\"wp-image-52\"/></figure>\n<!-- /wp:image --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column {\"columnVerticalAlignment\":\"center\"} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column gb-is-vertically-aligned-center\"><div class=\"gb-block-layout-column-inner\"><!-- wp:heading {\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<h2 class=\"has-text-color\" id=\"contact\" style=\"color:#3c3c3c\"> Want to get in touch?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#3c3c3c\"}},\"fontSize\":\"small\",\"gbResponsiveSettings\":{\"600px\":{\"fontSize\":\"small\"}}} -->\n<p class=\"has-text-color has-small-font-size\" style=\"color:#3c3c3c\">I\'m super friendly, a little chatty and always looking for a new challenge. If you think I\'d be a good fit for your next job, let\'s connect and see where it goes!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:genesis-blocks/gb-button {\"buttonText\":\"Contact Me\",\"buttonBackgroundColor\":\"#7a7a53\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\",\"buttonTarget\":true} -->\n<div class=\"wp-block-genesis-blocks-gb-button gb-block-button\"><a href=\"https://www.madfall.digital/landing-page/contact/\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#7a7a53\">Contact Me</a></div>\n<!-- /wp:genesis-blocks/gb-button --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":2,\"layout\":\"gb-2-col-equal\",\"columnsGap\":4,\"marginBottom\":3,\"marginUnit\":\"%\",\"paddingTop\":8,\"paddingRight\":5,\"paddingBottom\":5,\"paddingLeft\":5,\"paddingUnit\":\"%\",\"customTextColor\":\"#3c3c3c\",\"customBackgroundColor\":\"#e6e6da\",\"columnMaxWidth\":900} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-columns-2 gb-2-col-equal gb-has-custom-background-color gb-has-custom-text-color gb-columns-center\" style=\"margin-bottom:3%;padding-top:8%;padding-right:5%;padding-bottom:5%;padding-left:5%;background-color:#e6e6da;color:#3c3c3c\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-4 gb-is-responsive-column\" style=\"max-width:900px\"><!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:heading {\"level\":3,\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<h3 class=\"has-text-color\" style=\"color:#3c3c3c\">Pixel Perfectionist</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\",\"gbResponsiveSettings\":{\"600px\":{\"fontSize\":\"small\"}}} -->\n<p class=\"has-small-font-size\">I enjoy the detail of my projects. I use a combination of the full site editing and my own custom code, to create a unique and beautiful website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<h3 class=\"has-text-color\" style=\"color:#3c3c3c\">Expertly Trained</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\",\"gbResponsiveSettings\":{\"600px\":{\"fontSize\":\"small\"}}} -->\n<p class=\"has-small-font-size\">I studied Web Design and Development with Skillcrush for three years. I\'m also an alumnus of the incredible Rocket VA Academy, led by my mentor, the super smart VA and business coach Debbie Rocket.  I believe in the power of community and working with others to solve problems so I am also a member of WPRockstar, a thriving community of WordPress Freelancers building amazing sites for clients.  </p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:heading {\"level\":3,\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<h3 class=\"has-text-color\" style=\"color:#3c3c3c\">Good Communicator </h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\",\"gbResponsiveSettings\":{\"600px\":{\"fontSize\":\"small\"}}} -->\n<p class=\"has-small-font-size\">Communication is key, as they say! We\'ll keep in regular contact about any projects we start to ensure you get the end result you\'re looking for. I\'ve spent many years in customer-facing roles and appreciate the need for clear, unfussy communication in any project or interaction.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<h3 class=\"has-text-color\" style=\"color:#3c3c3c\">Fair, Friendly Pricing</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">I work with each client directly to ensure their project is scoped and priced sensibly. We\'ll work through the costs before we even start.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:columns {\"style\":{\"color\":{\"background\":\"#c7e4e2\"}}} -->\n<div class=\"wp-block-columns has-background\" style=\"background-color:#c7e4e2\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"textAlign\":\"left\",\"level\":4} -->\n<h4 class=\"has-text-align-left\">Website Design and Build</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">Whether it\'s a brand new site, a refresh or a rebuild I can help.  I can take your ideas and build a custom site optimised for SEO and User Experience. I design with a mobile-first approach so your site will look good on all devices.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Copywriting</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">Ever stared at a blank screen, flummoxed about what to write? Words hold incredible power and I can help you with SEO-inspired web and blogs.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"textAlign\":\"left\",\"level\":4} -->\n<h4 class=\"has-text-align-left\">Search Engine Optimisation </h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">From Keyword research to local SEO I\'ll make sure Google loves your website as much as you do. For an extra nudge, I can help with thoughtful targeted adverts to generate leads.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Hosting and Maintenance </h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">Once a site is live it needs ongoing maintenance to keep it secure and functional. I take the worry out of your website with maintenance and hosting plans.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:genesis-blocks/gb-cta {\"buttonText\":\"Let\'s connect!\",\"buttonBackgroundColor\":\"#7a7a53\",\"buttonSize\":\"gb-button-size-small\",\"buttonShape\":\"gb-button-shape-circular\",\"buttonTarget\":true,\"ctaTextFontSize\":14,\"ctaBackgroundColor\":\"#e6e6da\",\"ctaTextColor\":\"#3c3c3c\"} -->\n<div style=\"background-color:#e6e6da;text-align:center\" class=\"wp-block-genesis-blocks-gb-cta gb-block-cta gb-font-size-14\"><div class=\"gb-cta-content\"><h2 class=\"gb-cta-title gb-font-size-32\" style=\"color:#3c3c3c\">Drop me a line!</h2><div class=\"gb-cta-text gb-font-size-32\" style=\"color:#3c3c3c\"><p>I\'m accepting new clients. Please drop me a line and let\'s get started with your next project!</p></div></div><div class=\"gb-cta-button\"><a href=\"https://www.madfall.digital/landing-page/contact/\" target=\"_blank\" rel=\"noopener noreferrer\" class=\"gb-button gb-button-shape-circular gb-button-size-small\" style=\"color:#ffffff;background-color:#7a7a53\">Let\'s connect!</a></div></div>\n<!-- /wp:genesis-blocks/gb-cta --></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group -->\n\n<!-- wp:social-links {\"customIconColor\":\"#c7e4e2\",\"iconColorValue\":\"#c7e4e2\",\"customIconBackgroundColor\":\"#7a7a53\",\"iconBackgroundColorValue\":\"#7a7a53\",\"openInNewTab\":true,\"size\":\"has-normal-icon-size\",\"align\":\"right\",\"layout\":{\"type\":\"flex\",\"justifyContent\":\"space-between\"}} -->\n<ul class=\"wp-block-social-links alignright has-normal-icon-size has-icon-color has-icon-background-color\"><!-- wp:social-link {\"url\":\"https://github.com/Georgina-Watt\",\"service\":\"github\"} /-->\n\n<!-- wp:social-link {\"url\":\"https://www.linkedin.com/in/georgina-w-81a749134/\",\"service\":\"linkedin\"} /-->\n\n<!-- wp:social-link {\"url\":\"https://www.instagram.com/madfall_digital/\",\"service\":\"instagram\"} /--></ul>\n<!-- /wp:social-links -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Homepage','','publish','closed','closed','','landing-page','','','2023-01-15 21:30:35','2023-01-15 21:30:35','',0,'http://localhost:8888/monochrome_pro/landing-page/',0,'page','',0),(16,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','','sample-post-1','','inherit','open','closed','','sample-post-1','','','2022-10-29 14:49:34','2022-10-29 13:49:34','',0,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/10/sample-post-1.jpg',0,'attachment','image/jpeg',0),(18,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','','sample-post-2','','inherit','open','closed','','sample-post-2','','','2022-10-29 14:49:34','2022-10-29 13:49:34','',0,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/10/sample-post-2.jpg',0,'attachment','image/jpeg',0),(19,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','<!-- wp:heading -->\n<h2>Tech Term PHP</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image -->\n<figure class=\"wp-block-image\"><img alt=\"\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>When you ask a web server for a page, it’s PHP’s job to create it. When you browse a WordPress blog or make a post on Facebook, PHP is putting it all together.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you wanted a very simple PHP page to greet you every time you looked at it, it might look something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><code>&lt;?php echo “Hi there stranger!”; ?&gt;</code></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>That would make a web page that looked like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hi there stranger!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>One of the reasons many people learn PHP instead of Ruby or Python is that it comes installed on pretty much every web server out there. If you happen to have a bit of web space to your name, chances are you’re able to run PHP.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A pretty typical way you’ll see people working with PHP is along with Linux (an operating system),&nbsp;<a href=\"https://skillcrush.com/2012/07/03/web-server-2/\">Apache</a>&nbsp;(a web server),&nbsp;<a href=\"https://skillcrush.com/2012/12/04/mysql-2/\">MySQL</a>&nbsp;(a database), and PHP. This kind of setup is called LAMP.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>COCKTAIL PARTY FACT</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>PHP supposedly stands for “PHP: Hypertext Preprocessor.” If you said “Hey, but that doesn’t say what PHP means!” then you get the point ;).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#3c3c3c\">This blog entry was first written and published by Skillcrush. I highly recommend their online courses to anyone wishing to learn web design and development.</p>\n<!-- /wp:paragraph -->','Tech Term: PHP','','publish','open','closed','','tech-term-php','','','2023-01-15 21:25:43','2023-01-15 21:25:43','',0,'http://localhost:8888/monochrome_pro/2022/10/29/understanding-the-benefits-of-good-nutrition/',0,'post','',0),(20,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','','sample-post-3','','inherit','open','closed','','sample-post-3','','','2022-10-29 14:49:34','2022-10-29 13:49:34','',19,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/10/sample-post-3.jpg',0,'attachment','image/jpeg',0),(21,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','<!-- wp:heading -->\n<h2>Why Every Entrepreneur Needs a Virtual Assistant</h2>\n<!-- /wp:heading -->\n\n<!-- wp:gallery {\"linkTo\":\"none\",\"sizeSlug\":\"full\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":22,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://www.madfall.digital/wp-content/uploads/2022/10/sample-post-4.jpg\" alt=\"\" class=\"wp-image-22\"/></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>Do you ever feel like you’re just too busy to get everything done? That’s where a virtual assistant can help. A virtual assistant can take care of tasks that you don’t have time for, allowing you to focus on your business. Here are six reasons why every entrepreneur should have a virtual assistant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1. You realise you can’t do it all but you need help to keep your business running efficiently<br>2. A virtual assistant can take care of tasks that you don’t have time for or don’t know how to do<br>3. They’re affordable and can save you money in the long run<br>4. You can work with a virtual assistant from anywhere in the world<br>5. They’re experts in their field and can help you grow your business<br>6. They’ll make your life easier and allow you to focus on what’s important – your business!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#373737\"}}} -->\n<p class=\"has-text-color\" style=\"color:#373737\">If you’re like most entrepreneurs, you wear a lot of hats,&nbsp; from sales and marketing to product development and customer service. And while this can be rewarding, it can also be extremely taxing – especially if you’re trying to do it all on your own. That’s where a virtual assistant comes in. Ready to take the plunge? Drop me an email and I’d be happy to work with you, lighten your load and help you grow your business.</p>\n<!-- /wp:paragraph -->','Why Every Entrepreneur Needs a Virtual Assistant','','publish','open','closed','','unplug-and-connect-with-your-soul','','','2022-12-23 13:18:20','2022-12-23 13:18:20','',0,'http://localhost:8888/monochrome_pro/2022/10/29/unplug-and-connect-with-your-soul/',0,'post','',0),(22,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','','sample-post-4','','inherit','open','closed','','sample-post-4','','','2022-10-29 14:49:34','2022-10-29 13:49:34','',21,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/10/sample-post-4.jpg',0,'attachment','image/jpeg',0),(23,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','<!-- wp:heading -->\n<h2>Why every Small Business Should Hire a Website Developer</h2>\n<!-- /wp:heading -->\n\n<!-- wp:gallery {\"linkTo\":\"none\",\"sizeSlug\":\"full\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":24,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://www.madfall.digital/wp-content/uploads/2022/10/sample-post-5.jpg\" alt=\"Web Designer Laptop\" class=\"wp-image-24\"/></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#3c3c3c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#3c3c3c\">So you\'re running a small business?  Having a website makes your business seem trustworthy, legitimate and makes your brand more visible.  But if you\'re not a \"techy\" type entering the website world can become an overwhelming experience. To address this one of the most popular ways to build and launch a website has been with website builders such as Wix and Squarespace.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Renowned for their simplicity and “no coding” approach but if you are not the tech-savvy or design-orientated type, building even the most simple website will become time-consuming and without a willingness to dedicate time and learn the process it will become a frustrating waste of your time.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>That’s where a professional can help, and here are six reasons why should hire a professional rather than try and go it alone.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>From domain names to hosting providers, there is a lot to think about. If you have no prior knowledge an expert can talk you through the options available and help you find the best value product to get your website live.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Often a business or brand outgrows its platform and struggles to implement changes.  As the business grows, they may want to manage their blog or brand their site in a more personalised and customised way.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>If you have a website at some point you are going to want to manage your Search Engine Optimisation (SEO), how your website performs in search engine results (SERP) and how it is performing and loading. Nothing turns a potential customer off more than a slow and clunky website.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Security is an obvious biggie with websites, a professional can make sure you have the right certificates and updates to avoid bad people infiltrating your site.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Your website needs to be compliant with GDPR and have a cookie usage policy. Images or text must be licenced to keep your site legal.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Finally but most importantly, you’re a busy entrepreneur! I believe your time is best spent serving your clients and customers rather than sweating over block placements.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>In conclusion, your time and sanity is better spent on your business than drop me an email, I’ll be happy to talk through your options and help you set your site up in no time.</p>\n<!-- /wp:paragraph -->','Why every Small Business Should Hire a Website Developer','','publish','open','closed','','why-every-small-business-should-hire-a-website-developer','','','2023-01-15 21:19:46','2023-01-15 21:19:46','',0,'http://localhost:8888/monochrome_pro/2022/10/29/increase-your-productivity-as-a-working-parent/',0,'post','',0),(24,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','','Coffee and Laptop','','inherit','open','closed','','sample-post-5','','','2022-11-09 10:11:16','2022-11-09 10:11:16','',23,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/10/sample-post-5.jpg',0,'attachment','image/jpeg',0),(25,1,'2022-10-29 14:49:34','2022-10-29 13:49:34','{\"fields\":[{\"id\":\"0\",\"type\":\"name\",\"label\":\"Name\",\"format\":\"first-last\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"simple_placeholder\":\"\",\"simple_default\":\"\",\"first_placeholder\":\"\",\"first_default\":\"\",\"middle_placeholder\":\"\",\"middle_default\":\"\",\"last_placeholder\":\"\",\"last_default\":\"\",\"css\":\"\"},{\"id\":\"1\",\"type\":\"email\",\"label\":\"Email\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"placeholder\":\"\",\"confirmation_placeholder\":\"\",\"default_value\":false,\"filter_type\":\"\",\"allowlist\":\"\",\"denylist\":\"\",\"css\":\"\"},{\"id\":\"2\",\"type\":\"textarea\",\"label\":\"Message\",\"description\":\"\",\"required\":\"1\",\"size\":\"medium\",\"placeholder\":\"Your Message Here\",\"limit_count\":\"1\",\"limit_mode\":\"characters\",\"default_value\":\"\",\"css\":\"\"}],\"id\":\"25\",\