al-background-mar','','','2022-11-09 10:19:52','2022-11-09 10:19:52','',0,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/11/a_s_soft.jpeg',0,'attachment','image/jpeg',0),(92,1,'2022-11-09 10:52:36','2022-11-09 10:52:36','','IMG_BE6B95CEFDA1-1','','inherit','open','closed','','img_be6b95cefda1-1','','','2022-11-09 10:52:36','2022-11-09 10:52:36','',10,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/11/IMG_BE6B95CEFDA1-1.jpeg',0,'attachment','image/jpeg',0),(93,1,'2022-11-09 10:54:37','2022-11-09 10:54:37','','code_and_coffee','','inherit','open','closed','','code_and_coffee','','','2022-11-09 10:54:37','2022-11-09 10:54:37','',10,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/11/code_and_coffee.jpg',0,'attachment','image/jpeg',0),(97,1,'2022-11-09 11:11:30','2022-11-09 11:11:30','','Mock up of stylish accessories on desk at home office. Blank copy space screen of personal computer, textbook, glass of water and fresh bouquet on table. Student\'s workplace. Nobody around','Mock up of stylish accessories on desk at home office. Blank copy space screen of personal computer, textbook, glass of water and fresh bouquet on table. Student\'s workplace. Nobody around','inherit','open','closed','','mock-up-of-stylish-accessories-on-desk-at-home-office-blank-copy-space-screen-of-personal-computer-textbook-glass-of-water-and-fresh-bouquet-on-table-students-workplace-nobody-around','','','2022-11-09 11:11:42','2022-11-09 11:11:42','',13,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/11/AdobeStock_427462907-1.jpeg',0,'attachment','image/jpeg',0),(102,1,'2022-11-10 08:04:49','2022-11-10 08:04:49','','Mock up of stylish accessories on desk at home office. Blank copy space screen of personal computer, textbook, glass of water and fresh bouquet on table. Student\'s workplace. Nobody around','Mock up of stylish accessories on desk at home office. Blank copy space screen of personal computer, textbook, glass of water and fresh bouquet on table. Student\'s workplace. Nobody around','inherit','open','closed','','mock-up-of-stylish-accessories-on-desk-at-home-office-blank-copy-space-screen-of-personal-computer-textbook-glass-of-water-and-fresh-bouquet-on-table-students-workplace-nobody-around-2','','','2022-11-10 08:04:49','2022-11-10 08:04:49','',13,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/11/pink.jpg',0,'attachment','image/jpeg',0),(123,1,'2022-11-10 10:28:10','2022-11-10 10:28:10','','AdobeStock_96256808_Preview','','inherit','open','closed','','adobestock_96256808_preview','','','2022-11-10 10:28:10','2022-11-10 10:28:10','',13,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/11/AdobeStock_96256808_Preview.jpeg',0,'attachment','image/jpeg',0),(130,1,'2022-11-10 11:10:12','2022-11-10 11:10:12','<!-- wp:paragraph -->\n<p>Privacy Policy</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This website address is https//:www.madfall.digital</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Comments</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor’s IP address and browser user agent string to help spam detection.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Media</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Cookies</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select “Remember Me”, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Embedded content from other websites</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Analytics</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Who we share your data with</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you request a password reset, your IP address will be included in the reset email.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>How long we retain your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>What rights you have over your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Where we send your data</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Visitor comments may be checked through an automated spam detection service.</p>\n<!-- /wp:paragraph -->','Privacy Policy','','publish','closed','closed','','privacy-policy','','','2022-11-16 18:47:58','2022-11-16 18:47:58','',13,'http://localhost:8888/monochrome_pro/?page_id=130',5,'page','',0),(189,1,'2022-11-10 14:32:26','2022-11-10 14:32:26','Photo of Georgina Tech Va and web designer with two goats','IMG_1227','','inherit','open','closed','','img_1227','','','2022-11-13 09:10:45','2022-11-13 09:10:45','',10,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/11/IMG_1227.jpg',0,'attachment','image/jpeg',0),(190,1,'2022-11-10 14:34:23','2022-11-10 14:34:23','','me','','inherit','open','closed','','me','','','2022-11-10 14:34:23','2022-11-10 14:34:23','',10,'http://localhost:8888/monochrome_pro/wp-content/uploads/2022/11/me.jpg',0,'attachment','image/jpeg',0),(211,1,'2022-11-10 17:45:22','2022-11-10 17:45:22','<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"verticalAlignment\":\"top\",\"width\":\"100%\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\" style=\"flex-basis:100%\"><!-- wp:genesis-blocks/gb-columns {\"columns\":4,\"layout\":\"gb-4-col-equal\",\"columnsGap\":3,\"align\":\"full\",\"paddingTop\":8,\"paddingRight\":1,\"paddingBottom\":6,\"paddingLeft\":1,\"paddingUnit\":\"em\",\"customTextColor\":\"#1f1f1f\",\"customBackgroundColor\":\"#e6e6da\",\"columnMaxWidth\":1200,\"className\":\"gb-slate-section-feature-image-and-text-columns gb-slate-section-feature-image-columns \"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-slate-section-feature-image-and-text-columns gb-slate-section-feature-image-columns gb-layout-columns-4 gb-4-col-equal gb-has-custom-background-color gb-has-custom-text-color gb-columns-center alignfull\" style=\"padding-top:8em;padding-right:1em;padding-bottom:6em;padding-left:1em;background-color:#e6e6da;color:#1f1f1f\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-3 gb-is-responsive-column\" style=\"max-width:1200px\"><!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-c